    xP = [51,52,53,54,55,1,56,57,58,59,60,61,62,63,6,7,8,9,10,11,12,64,65,66,67,15,16,17,18,19,20,21,22,23,26,27,28,29,30,31,32,35,36,37,38,39,42,43,44,47];
    P1 = [(1:46)*Pi 47:50];
    T = getT(M,[51:67 P1(1:end-44)],P1(end-43:end),xP);

    [V,~] = eig(T);
    S = V(41:43,:)./repmat(V(44,:),3,1);

    I = ~isnan(S(1,:)) & ~isinf(S(1,:));
    %I = I & ~imag(S(1,:)); % uncomment this line for real roots only
    S = S(:,I);

end